import React from 'react';
import { Carousel } from 'antd';
import { backGroundMain } from './data';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper.scss';

const Home = () => {
  const contentStyle = {
    height: '160px',
    color: '#fff',
    lineHeight: '160px',
    textAlign: 'center',
    background: '#364d79',
  };

  return (
    <Swiper spaceBetween={50} slidesPerView={3} style={{ width: '100%' }}>
      {backGroundMain.map((value, index) => {
        return (
          <SwiperSlide key={index}>
            <img src={value.image} />
          </SwiperSlide>
        );
      })}
    </Swiper>
  );
};

export default Home;
